insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (53, 'Estancia Campos De Lino', 'Torrejon del Rey - Guadalajara', 'Chalet independiente en parcela de 600 metros. Divido en 2 plantas sin escaleras son independientes las 2, la parte de arriba con 3 dormitorios muy amplios con armarios empotrados y maleteros grandes, aire acondicionado con bomba cde calor y calefaccion por gasoil, ventanas de pvc Climalit 10 y mosquiteras, las puertas son de ancho para minusvalidos, para baño. Completo con ventana mosquitera y bañera, cocina completa con mesa y banco 2 ventanas, vitroceramica de induccion, puerta corredera para no entorpecer en la cocina salon con 2 terrazas grande con chimenea. Una de ellas esta cerrada con cerramiento y sirve para habitacion o despacho o q se requiera a gusto de las necesidades de ca uno, tiene mucho sol y vistas al jardin, suelos rusticos. Terraza abierta mas diminuta para tender y da a la piscina y vistas, entrada con una cancela cerrada de aluminio y ventana oscilobatiente y puerta corredera antimosquitos y entrada a la casa con holl amplio q de frente el salon, derecha habitaciones e izda. Cocina. Portero automatico y puerta con motor para meter el coche si uno quiere hay suficiente para aparcar fuera, pero tiene su cochera por si quieres meter motos o bicis. Segunda vivienda las dos miden 150metros cada una. Entras y tienes un salon garaje muy grande con armario, para lavadora o secadora y preparada para poner pila si quieres, cuarto de calderas con deposito 750 litros y tiene espacio para trastos, 2 habitaciones una forrada toda de madera con armario empotrados 3 cuerpos mas maleteros amplios da a la piscina, otro salon muy grande con la cocina tipo isla y chimenea, tiene unas puertas correderas grandes para diferenciar los espacios, luego otra habitacion con puerta corredera aire acondicionado y bomba de calor y baño completo con ventana mosquitera y plato de ducha. Esta para entrar a vivir.', 'chalet.jpeg', 'CHALET', 803.38, 300 , 5, 2, false, true, true, true, 24, '2bd9e760-a11e-5d8f-9641-1c54e79c57a1');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (54, 'Piso Acogedor', 'Casco Antiguo, Caceres', 'Se alquila apartamento muy luminoso en la zona de Caceres. Tiene una superficie de 55 m2, distribuidos en 2 habitaciones, 1 baño, comedor y cocina, con electrodomesticos. Es exterior, con una excelente situacion cerca de colegio, farmacia, ambulatorio, parque y parada de bus. CIUDAD MONUMENTAL. Apartamento de unos 65 m2 aproximadamente a menos de 2 minutos andando de la Plaza Mayor de 2 dormitorios(el principal con cama de matrimonio de 1,35 y armario de 4 puertas y el pequeño con cama de 90 y armario empotrado de 2 puertas, 1 baño completo con bañera, salon comedor con cocina americana mas arcon congelador y terraza de unos 25 m2 aproximadamente. Totalmente amueblado, suelos de tarima. Aire acondicionado y calefaccion individual electrifica. Todo exterior y muy luminoso. No mascotas. Comunidad e internet incluidos en el precio. Gente seria y responsable que acredite sus ingresos.', 'piso.jpeg', 'PISO', 450, 55, 2, 1, false, false, true, false, 13, '2bd9e760-a11e-5d8f-9641-1c54e79c57a1');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (55, 'Casa Los Rodriguez', 'La Sierrilla, Caceres', 'Situado en la Sierrilla, la zona de mayor exquisitez urbanistica de Caceres. Es una construccion de diseño proyectada sobre una parcela de 1142 metros cuadrados, con diversos tipos de arboles frutales, palmeras, dos porches cubiertos en la estructura de la vivienda y una pergola para las noches de verano; piscina con iluminacion interna y riego por aspersores, espacio vallado con casita para perro y casa de almacenaje con la depuradora. La vivienda se construyo en el año 2000 con materiales de maxima calidad y todo tipo de detalles y comodidades. Cuenta con 145 metros cada una de las tres plantas, estando el garaje integrado en la estructura de la vivienda. Se diseño con el proposito de sacarle el mayor rendimiento a su orientacion y con diversas capas de materiales de gran consistencia en aislamiento para evitar cualquier tipo de problematica en cuanto a humedad. Considerando la amplitud de las estancias, se distribuye en salon de doble ambiente, dos cocinas equipadas con todos los electrodomesticos, cinco dormitorios con armarios empotrados –el principal tiene terraza, armario corrido tipo vestidor y baño completo con hidromasaje tres baños y un aseo, despensas y estancias de almacenaje.  Como caracteristicas mas destacadas cuenta con calefaccion por gasoleo, independiente en cada planta, aire acondicionado por conductos, tambien independiente, puertas blindadas, suelo de tarima, azulejos Porcelanosa, carpinteria de roble de gran calidad, ventanas de doble acristalamiento y climalit, hilo musical en todas las estancias… Comunidad de 42Euros por mantenimiento de la urbanizacion.', 'casa.jpeg', 'CASA', 1500.94, 435, 5, 4, false, true, true, true, 36, '2bd9e760-a11e-5d8f-9641-1c54e79c57a1');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (56, 'Casa Rural', 'Urb. El Fargue, Albaicin, Granada', 'Casa independiente con: 3 dormitorios. Amplio salon con cocina incorporada. Baño. Patio exterior. Porche. Con 2000 metros de parcela, en el precio esta incluido el agua de la acequia ainadamar y las placas solares. Agua potable de pago. Calefaccion de gasoleo. Chimenea. Totalmente amueblada. Autobus urbano a tres minutos. Tarifa TAXI ciudad.', 'casa1.jpg', 'CASA', 1100, 100, 3, 1, false, false, false, true, 23, '99ec6bb0-6c98-593c-812b-86ab4de48361');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (57, 'Piso en alquiler en FLOTA DE INDIAS', 'Ramon de Carranza - Madre Rafols, Sevilla', 'FANTaSTICA VIVIENDA en primera planta alta de gran edificio de LOS REMEDIOS. GRAN OPORTUNIDAD DE VIVIR MIRANDO AL ALJARAFE SEVILLANO Y A LA FERIA. Magnifico piso en venta en el Barrio de Los Remedios, exterior de 4 habitaciones que goza de gran situacion, a unos minutos de la parada de Metro. Proximo a colegios de la zona, comercios y servicios de autobuses, a un paso de la Feria y del conocido Parque de los Principes. La vivienda es luminosa donde poder disfrutar de grandes vistas, podra convertirla en un hogar maravilloso y confortable, con distintas posibilidades de reforma. El Piso cuenta con muchas posibilidades un hall de entrada desde donde se distribuye la vivienda, con un posible gran salon – comedor con salida a una amplia terraza que comunica con la calle Flota de Indias. Junto al salon se encuentra un baño que dara servicio a sus invitados. Frente al salon podra disfrutar de un fantastico espacio donde montar una moderna cocina, y un lavadero donde poder lavar su colada. En el pasillo nos encontramos con estancias de 4 dormitorios, algunos con Armarios Empotrados y 2 baños completos, uno de ellos en Suite en el dormitorio principal. Su distribucion permite sacar dos fantasticos vestidores donde ubicar todas sus pertenencias. Para su bienestar, el edificio posee dos ascensores y en el portal tiene acceso para personas con movilidad reducida. La propiedad posee una plaza de garaje incluida en el precio y situada en el mismo edificio, donde se accede desde el ascensor que les lleva a su vivienda. ¿Quiere saber mas? Estamos encantados de ayudarle a elegir el mejor hogar para su familia.', 'piso1.jpeg', 'PISO', 765.22, 222, 4, 2, true, false, true, false, 43, 'ce802e0d-45d6-55ca-90f2-5dc19d03f327');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (58, 'Piso barato en Barcelona', 'Les Roquetes, Barcelona', 'Piso en alquiler en Barcelona. Dispone de una superficie de 59 m2 distribuidos en salon-comedor muy luminoso con acceso a balcon, 3 habitaciones, cocina y 1 baño. Situado en una zona cerca de servicios, comercios, paradas de autobus y la parada de metro Roquetes (L3). Con facil acceso a la B-20. Se alquila sin amueblar.', 'piso2.jpeg', 'PISO', 788.51, 65, 3, 1, false, false, true, false, 10, 'de4fab48-c431-54b6-ac87-3d5856774866');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (59, 'Piso en Fotografo Angel Llanos, 14', 'As Travesas - Balaidos, Vigo', 'Se alquila precioso piso nuevo en Fotografo angel Llanos, muy cerca de Florida, Balaidos, Plaza America y zona de playas. Inmejorable situacion. Cuenta con todos los servicios necesarios cerca, asi como supermercados, paradas de autobus, entidades bancarias, parques, colegios, farmacias, etc… El piso se alquila amueblado y se distribuye en hall de entrada, cocina completamente equipada con todos los electrodomesticos (horno, vitro, campana, frigorifico combi, microondas, LAVAVAJILLAS), zona de lavadero con lavadora y tendal, amplio salon comedor con todo tipo de mobiliario y sofa con mecanismo electrico, dos dormitorios completos con armarios empotrados (camas de 135 y 90 cm respectivamente), tercera habitacion VESTIDOR con grandes armarios empotrados con mucho espacio y dos baños completos ambos con plato de ducha. Tambien dispone una buenisima plaza de garaje en el mismo edificio incluida en el precio y un trastero individual con suelo de plaqueta. Buenisimas calidades de construccion en toda la vivienda, electrodomesticos de primeras marcas y ventanas aislantes. Se aceptan mascotas siempre y cuando se haga la visita con la misma y se cumplan requisitos.', 'piso.jpeg', 'PISO', 770, 88, 2, 2, true, false, false, true, 40, '3724f1a1-cfed-52ec-b1fa-9c41b6928648');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (60, 'Esmeralda (Chalet adosado en calle Toronga, 11)', 'Conde Orgaz-Piovera, Madrid', 'Se alquila duplex de 250 metros en la zona de Arturo Soria una de las mas prestigiosas de la ciudad, a 3minutos andando del Liceo Frances. La vivienda consta de 3 dormitorios, el ppal. en suite y los otros 2 dobles comparten un baño y en la planta baja se encuentra una gran cocina de 45 m2 con zona de comedor para 8 personas y barra de. desayuno. Se encuentra un gran salòn con salida a la piscina y jardin privado para uso exclusivo del inquilino, y un aseo. La casa dispone de trastero En las inmediaciones se encuentran varios colegios de. prestigio y centros comerciales como. Carrefour, Mercadona, Palacio de hielo, El corte ingles etc. Muy bien comunicado con varias lineas de autobuses y el metro de Arturo soria. La vivienda se entrega semi amueblada.', 'chalet1.jpeg', 'CHALET', 2495.6, 235, 3, 3, false, true, true, true, 33, 'f87239fd-e902-5cf7-8e9e-4b85bf5d323d');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (61, 'Piso en Zapillo', 'C/ Paterna del Rio, Almeria', 'Si lo que estas buscando es un apartamento en el mismo Paseo Maritimo, aqui tienes la oportunidad. Un amplio salon con grandes ventanales que entra luz por doquier. Dormitorio con gran armario empotrado. Si te gusta oler a mar y disfrutar del paseo maritimo todo el año ya puedes venir a verlo. Parada de autobus al bajar de casa, todo tipo de comercios en la zona como supermercados, fruterias, restauracion, etc.', 'piso1.jpeg', 'PISO', 550.65, 55, 1, 1, true, false, true, false, 5, '99ec6bb0-6c98-593c-812b-86ab4de48361');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (62, 'Chalet independiente en calle de Santa Isabel, 51', 'Els Masos, El Vendrell', 'Casa individual con piscina privada distribuida en dos plantas, situado en la urbanizacion Dels Garrofers zona muy tranquila con poco trafico. En la entrada nos encontramos con dos zonas de terraza, en una de ellas tenemos un fabuloso chill out para disfrutar de las noches de verano y un fabuloso garaje! Al entrar por la puerta principal de la vivienda encontrara recibidor, cocina, aseo y comedor con chimenea con salida a un porche exterior y piscina En la primera planta, se encuentran los 4 dormitorios tres de ellos dobles y 2 cuartos de baño uno de ellos en la Suite. La decoracion es detallista, ofreciendo un ambiente acogedor. Tiene una superficie construida de 397 metros cuadrados. Tiene a su disposicion un jardin fabuloso con cesped artificial y jardinera que no le haran ser un esclavo para su mantenimiento. Encontrara la piscina y un cuarto de maquinas en la parte posterior del chale con ducha exterior. En esta casa, podra disfrutar de un micro clima todo el año y de la vida en exterior. Tambien tiene una barbacoa de piedra fija y facilidades para cocinar. La Urbanizacion cuenta con servicios y comodidades. A escasos minutos de la playa de Coma-ruga incluso caminando y muy cercano a supermercados y gasolinera. Excelente comunicacion con (AP-7, C-32) carretera y tren. Junto al Vendrell, que la abastece de todos los servicios indispensables para su bienestar: hospital, farmacias, colegios, comercios…A tan solo 45 minutos de Barcelona y su aeropuerto. Esta muy bien conservada y equipada con calefaccion de gas natural y aire acondicionado, armarios empotrados y mucho mas.', 'chalet2.jpeg', 'CHALET', 1500.08, 397, 4, 3, false, true, true, true, 45, '3e35d4f4-7716-54b2-9bdf-805ac4f5b6f0');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (63, 'Casa adosado en calle Vicente Trueba, 7', 'Alisal - Cazoña - San Roman, Santander', 'Urbanizacion Altamira, chalet adosado, en zona residencial. Puesto con muy buen gusto…  Impecable. Cuenta con 4 plantas. Planta sotano con 2 grandes trasteros, zona de almacenaje y lavadoras y un amplio garaje cerrado tambien con zona de almacenaje. Planta baja con un porche de entrada cerrado, cuarto de baño completo, amplia cocina completamente equipada y gran salon comedor con chimenea y salida al jardin (35m2). Planta primera con 3 habitaciones completas (la suite con vestidor) y cuarto de baño con bañera de hidromasaje. Planta segunda o bajo cubierta, gran habitacion/espacio multiusos, diafano con dos velux.', 'casa1.jpg', 'CASA', 1200.44, 180, 4, 2, false, false, true, true, 15, 'ce802e0d-45d6-55ca-90f2-5dc19d03f327');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (64, 'Piso en calle medinaceli', 'Centro, Soria', 'Se alquila excepcional y luminosa vivienda en quinta planta con unas vistas unicas al parque de la Dehesa, y con una ubicacion inmejorable dentro de la zona centro de la ciudad. Una oportunidad excelente de vivienda de calidad en la capital soriana. Perfecta para funcionarios/trabajadores que busquen compartir una vivienda amplia, o pareja/familia. La finca es un edificio regio y de estilo arquitectonico sobrio, elegante y minimalista. Y la vivienda cuenta con abundante luz natural en diferentes orientaciones a lo largo del dia, vistas alegres y extensas y amplitud en sus estancias. La casa, ubicada en una quinta planta, cuenta con orientacion Oeste fundamentalmente, y con un balcon que da al famoso parque de la Dehesa, pulmon verde de la ciudad, uno de los puntos fuertes de la vivienda, pues brindan unas vistas inigualables del entorno durante todo el dia. 84 m2 utiles de vivienda que se reparten en recibidor, gran salon comedor, amplia cocina independiente, 3 dormitorios dobles y 2 baños completos. Electrodomesticos nuevos a estrenar en la cocina, baños recien reformados en su totalidad y mobiliario nuevo mezclado con otras piezas mas clasicas y en perfecto estado y calidades. El suelo es de parquet y la calefaccion es central con radiadores originales metalicos (la mejor opcion para Soria). Y la iluminacion es de tipo LED de bajo consumo. Armarios y demas muebles de almacenaje en cada estancia. La finca cuenta con dos ascensores y portero fisico, y la vivienda se alquila con una plaza de garaje en el mismo edificio incluida en el precio. Los gastos de suministros de agua caliente y calefaccion se cobran con un fijo incluido en el precio al mes de 150€. Si hubiera un exceso de consumo en los suministros se notificaria y cobraria a parte. Luz y agua fria a parte, a domiciliar en la cuenta bancaria del inquilino, y abonar segun consumo.', 'piso.jpeg', 'PISO', 900.71, 84, 3, 2, true, false, true, true, 44, '3724f1a1-cfed-52ec-b1fa-9c41b6928648');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (65, 'Estancia Campos De Lino en avenida de Los Recreos', 'Giron - Villa del Prado, Valladolid', 'Se alquila casa de una planta con patio en el barrio Giron. La vivienda esta totalmente reformada y cuenta con tres dormitorios, salon, cocina amueblada y equipada con todos los electrodomesticos y un baño. Amueblada. Patio de noventa metros cuadrados y almacen con porton (no tiene vado). Se encuentra en la parte baja del barrio, junto a Mieses. Se piden nominas y fianza. Ven a visitarla.', 'casa2.jpeg', 'CASA', 850.19, 79, 3, 1, false, false, true, true, 50, 'de4fab48-c431-54b6-ac87-3d5856774866');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (66, 'Piso en Sagasta', 'Centro Historico - Plaza España, Cadiz', 'Piso en alquiler como vivienda habitual. Tiene 3 dormitorios uno interior y dos exteriores. Salon con dos balcones, exterior. Cocina amueblada sin electrodomesticos, solo tiene placa de gas. Termo de gas butano. El cuarto de baño tiene ducha. La vivienda no esta amueblada. Es una 4ª planta SIN ASCENSOR, es la ultima planta del edificio, muy luminoso y centrico. La azotea esta disponible para poder tender. Tiene supermercados cerca, zona comercial, centro historico. Las condiciones de alquiler son las siguientes, un mes de fianza para depositar en la J. A., contrato de vivienda habitual, y presentar documentos y nominas que justifiquen la capacidad de pago de la renta del alquiler, (superar el S. M. I mas el importe del alquiler). Los honorarios de inmobiliaria son el importe de renta mas los impuestos correspondientes por parte del inquilino. Es necesario dar de alta los suministros de luz y de agua. El importe del alquiler son 600€ mensuales.', 'piso2.jpeg', 'PISO', 600.14, 60, 3, 1, false, false, true, false, 14, '99ec6bb0-6c98-593c-812b-86ab4de48361');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (67, 'El Refugio, Casa en calle Albahaca Nº36', 'Hervencias Altas - El Pinar, avila', 'COMO ES: Esta es una vivienda unifamiliar adosada, situada en una zona residencial consolidada y muy reconocida de la moderna ampliacion de la Ciudad, totalmente exterior, independiente en todos sus servicios, con una orientacion excelente, suroeste en la fachada de parcela y noroeste en la de la entrada. Super luminosa y bien soleada con espacio de vida y de ocio de grandes proporciones. Muchas actualizaciones de calidades y materiales como las ventanas de PVC, la tarima AC6, la ampliacion del espacio libre en el salon, el completisimo equipamiento de la cocina que incluye electrodomesticos de gama alta o el atico totalmente acondicionado para multiples usos. QUE INCLUYE: La vivienda se encuentra distribuida en tres plantas, la baja, con vestibulo, salon comedor, cocina, baño, el garaje y la parcela de ocio que tiene dos zonas, la de estar con un porche acondicionado y cerrado acristalado y la de la jardin, en la que se puede instalar una piscina o cualquier otra instalacion de disfrute, jardin y perfectamente perimetrada. La primera planta contempla tres dormitorios de tamaño muy generoso, el principal tipo suite y con un practico, vestidor, y dos cuartos de baños. En la planta superior, la del atico, un espacio diafano de planta entera que tiene multiples posibilidades de distribucion y aprovechamiento. QUE POSIBILIDADES TIENE: Tanto por necesidad familiar o simplemente porque quieres mas espacio, vivir de forma independiente o acceder a la calidad de vida que ofrecen estas vivienda, esta es perfecta. Porque ademas de haberse mejorado muchisimo en su calidades y equipamiento se encuentra en un estado impecable, lista para amueblar y disfrutar. SU ENTORNO Y UBICACION: La v vivienda forma parte de la Urbanizacion Dehesa del Pinar. un conjunto urbanistico desarrollado hace unos 15 años y que mantuvo la estructura e imagen construida y que ha dado lugar a una urbanizacion muy agradable, y comoda par vivir. Facilmente accesible cuenta con zonas ajardinadas, con espacios de juegos infantiles, tiene paradas de autobus urbano y en coche se tarda 10 minutos en llegar al Centro de la Ciudad ademas de estar bien conectaba con el resto de zonas y las salidas principales a otras vias.', 'casa.jpeg', 'CASA', 900.77, 202, 3, 3, false, false, true, true, 7, '3e35d4f4-7716-54b2-9bdf-805ac4f5b6f0');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (68, 'Chalet independiente en calle Lamas de Prado, 66 B', 'La Milagrosa, Lugo', 'Casa independiente que en su planta baja se accede al garaje. La primera planta consta de dos habitaciones, una de ellas de matrimonio, la segunda con dos camas gemelas de 90cm, baño completo y un amplio salon comedor, la cocina esta equipada con electrodomesticos y da acceso a la joya de la casa que es una gran terraza cubierta bien orientada para aprovechar asi gran cantidad de luz durante todo el dia. Y para finalizar en la segunda planta tambien incluimos una zona completamente diafana y con entrada de luz natural.', 'chalet2.jpeg', 'CHALET', 420.34, 150, 2, 1, false, false, true, true, 31, '3724f1a1-cfed-52ec-b1fa-9c41b6928648');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (69, 'Casa independiente en calle Naon, 20 A', 'Viella-Granda-Meres, Siero', 'Se alquila CASA con JARDiN en la Carretera de Viella de Lugones, muy cerca de Lugones donde tiene todos los servicios y del CC Parque Principado. Es una casa de dos plantas con dos viviendas y de la que se alquila la planta baja. Con una superficie de 93 m2 distribuidos en 3 dormitorios, salon, cocina amueblada y equipada con electrodomesticos y baño. Dos de los dormitorios estan amueblados. La casa incluye jardin, garaje, una caseta de aperos y una zona con barbacoa. La calefaccion es de gas natural.', 'casa.jpeg', 'CASA', 650.24, 93, 3, 1, false, false, true, true, 6, 'de4fab48-c431-54b6-ac87-3d5856774866');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (70, 'Chalet independiente en ronda San Cristobal', 'Cizur, Navarra', 'Espectacular vivienda unifamiliar con mucho encanto, calida y acogedora con muy buena calidad constructiva ademas de una excelente distribucion.  Destaca tambien su buena situacion dentro de la Urbanizacion. Si quieres vivir en un unifamiliar aislado en Zizur Mayor Urbanizacion ven a verlo! Cuenta con precioso jardin totalmente consolidado con piscina de 49 m2. Y acceso directo a zona comun de 7300 m2 con piscina y mobiliario jardin. La parcela es de 1326 m2 y esta muy bien orientada ademas de ser totalmente llana. De la distribucion de la casa hablaremos ahora, destacando la cantidad de luz y su gran distribucion ademas de sus amplios espacios y grandes ventanales. La vivienda cuenta con dos plantas sobre rasante y una planta bajo rasante. PLANTA BAJA: Desde esta planta podemos acceder de la calle directamente al jardin y a la vivienda por la puerta principal. Al acceder a la vivienda nos encontramos un gran vestibulo con doble altura y grandes ventanales que le dan mucha luz. En esta planta ademas tenemos un gran salon comedor con chimenea y diferentes ambientes, una amplia cocina con ventanal al jardin y salida al porche que cuenta con toldos automaticos y comunicado con el jardin de la casa. Ademas en esta planta tenemos 2 habitaciones dobles y dos baños, siendo una de ellas la habitacion principal con amplio ventanal al jardin y que cuenta con un gran vestidor y un baño en suite con ventana al jardin. PLANTA PRIMERA: A esta planta se accede desde una escalera que se situa en el vestibulo de la casa y que te llevara a las 4 amplias estancias dormitorios y dos baños que encontraremos en esta planta. Dos habitaciones cuentan con ventanas velux automaticas y otras dos con amplios ventanales al jardin y salida a balcon. PLANTA SOTANO: Esta planta cuenta con varias zonas bien diferenciadas. Por un lado tenemos el garaje de 41 m2, un gran txoko con cocina equipada de 133 m2 ademas de un gimnasio equipado y una bodega. Del gimnasio se puede acceder directamente al jardin. En esta planta hay ademas una habitacion y un aseo. La vivienda esta en perfecto estado y tienen muchas mejoras que paso a enumerar: -La carpinteria exterior es de Aluminio con rotura de puente termico y persianas motorizadas en toda la casa. Ademas cuentan con mosquiteras. -Toda la vivienda esta climatizada. Ademas de bien aislada. -El jardin cuenta con riego automatico por aspersion y por sectores. -La piscina esta en perfecto estado. En uno de los laterales de la casa, que esta pavimentado, se pueden dejar hasta 2 coches. En el garaje convencional caben otros 2. Ven a visitarla!', 'chalet1.jpeg', 'CHALET', 3000, 465, 6, 5, false, true, true, true, 37, 'ce802e0d-45d6-55ca-90f2-5dc19d03f327');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (71, 'Piso en calle Orient', 'Santa Eugenia, Girona', 'PROMOCIoN: 1 MES DE ALQUILER GRATIS si reservas antes del 28 de febrero. Y ademas, ¡sin comisiones de agencia! Piso en alquiler de 77 m² ubicado en Girona. Vivienda de segunda mano que pertenece a un edificio residencial construido en 1959 aproximadamente, localizado en la cuarta planta con la siguiente distribucion: salon-comedor con balcon, cocina con galeria amueblada independiente, equipada con placa vitroceramica, horno y campana extractora de humos, 3 dormitorios y 1 baño. Ademas, cuenta con armarios empotrados y radiadores para la calefaccion. Siempre es una inversion rentable. El inmueble esta ubicado en zona residencial consolidada, cerca de varios servicios y equipamiento como supermercados, cafeterias, plazas, centros deportivos, parques, centros educativos y otros establecimientos comerciales. Bien comunicado mediante estacion de tren a 7 minutos en coche y a 13 minutos andando. Tambien enlaza con las principales carreteras de la zona por su uso en menos de 5 minutos aproximadamente. Con nuestros servicios podra encontrar la vivienda que necesita. Empiece ahora mismo pidiendo mas informacion. Un responsable cercano a usted le atendera personalmente. “[A efectos informativos, se hace constar que el indice de referencia de precios de alquiler de la vivienda es de 9,21€/m2. ]” Requisitos: 1 mes de fianza. Seguro de vivienda y de impagos a cargo del inquilino. Se llevara a cabo un analisis de solvencia para el que solo se tendran en cuenta ingresos demostrables. Promocion valida para contratos firmados antes de 28 de febrero del 2023 (incluido). Esta promocion no es acumulable. Condiciones validas para inmuebles identificados en webs y portales con detalle promocional de campaña identificado en descriptivo del anuncio.', 'piso1.jpeg', 'PISO', 814.98, 76, 3, 1, false, false, false, false, 48, '3724f1a1-cfed-52ec-b1fa-9c41b6928648');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (72, 'Chalet independiente en calle Junco, 1', 'Alcolea, Cordoba', 'Chalet situado en Urbanizacion Encinares de Alcolea. Vivienda en planta baja tiene 5 estancias amplia cocina, salon con chimenea. La habitacion principal dispone de baño, vestidor. Buhardilla de 20m, sala de usos multiples de 29m en zona semisotano y garaje 40m. Aire acondicionado frio y caliente centralizado. Terreno con magnificas vistas a la campiña, la casa esta situada en la parte alta con magnificas vistas. Piscina con baño, vestuario y dos terrazas. Dispone de garaje, zonas ajardinadas, arboles frutales. A 12km de Cordoba. Espacio para plantar mas plantas, el terreno completo son 3200 metros cuadrados. Para amantes de las plantas y la naturaleza. SE ALQUILA A PARTIR DEL 15 DE ABRIL. Alquiler de larga duracion.', 'chalet2.jpeg', 'CHALET', 1250.36, 328, 5, 3, false, true, true, true, 19, 'f87239fd-e902-5cf7-8e9e-4b85bf5d323d');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (73, 'Piso en calle la Florida, 2', 'La Florida, Sevilla', 'Loftsevilla Consultores alquila vivienda a estrenar en el nuevo edificio de La Florida. Gran piso de dos dormitorios y dos baños completos, uno con bañera y el de la habitacion principal con plato de ducha, salon comedor con asceso directo a la terraza con vistas a las zonas comunes y cocina completa con todos los electrodomesticos con asceso directo tambien a la terraza. Electrodomesticos: horno electrico, microondas, placa vitroceramica y campana extractora, frigorifico, lavadora y lavavajillas. Soleria de tarima flotante, ventanas de PVC blancas por dentro y gris por fuera, doble acristalamiento y persianas automaticas en los dormitorios. Suministros de luz y agua no incluidos en el precio.', 'piso2.jpeg', 'PISO', 1350.78, 119, 2, 2, true, true, true, true, 43, 'ce802e0d-45d6-55ca-90f2-5dc19d03f327');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (74, 'Chalet independiente en Aljaraque', 'La Costa, Huelva', 'Fantastica vivienda de 2 plantas + buhardilla en el centro de Aljaraque. Vivienda de 130 M2, totalmente exterior y en perfecto estado de conservacion. En la primera planta cuenta con salon comedor, cocina totalmente amueblada y equipada con electrodomesticos con acceso a patio interior, y un aseo. En la segunda planta dispone de 2 dormitorios y baño completo con plato de ducha. En planta buhardilla dispone de un dormitorio y solarium de 20 M2 aproximadamente. La vivienda se alquila amueblada. Muy buena comunicacion con todo tipo de servicios y comercios. No se admiten mascota.', 'chalet.jpeg', 'CHALET', 700.06, 130, 3, 1, false, false, true, false, 25, '3724f1a1-cfed-52ec-b1fa-9c41b6928648');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (75, 'Casa independiente en calle Galia', 'Alicante Golf, Alicante / Alacant', 'Espectacular chalet de diseño de 500 m2, en parcela de 1.220 m2, en el corazon de la Playa de San Juan. Entre el Golf y el mar. Todo un lujo! Dispone de piscina privada y seis dormitorios, totalmente amueblados. 5 baños, dos de ellos con bañera de hidromasaje. La suite principal tiene mas de 40 metros, incluye cama de 2x2 metros con colchon de latex, persianas de seguridad automaticas, amplio vestidor, baño con ducha de marmol y bañera de hidromasaje con madera de Teka de la marca Jacuzzi, con luz bajo el agua y vistas al jardin, sistema multiclin de Roca en el wc, que integra el bide y el inodoro en una experiencia de lujo. Salon de 100 metros con chimenea automatica a gas, TV. Cocina isla y vistas al jardin y electrodomesticos Siemens. Zona lavadero, con lavadora de gran capacidad y 2 secadoras. Amplias zonas comunes interiores. Porches y terrazas de mas de 100 metros, dotados de tumbonas, y parasoles. Zona solarium piscina de cesped artificial. Tiene iluminacion nocturna automatica por led, iluminacion en piscina. Estores solares automaticos. Garaje cerrado para cuatro vehiculos. La villa esta situada en la zona del golf de la Playa de San Juan. Tiene acceso andando a todos los servicios, supermercado a 250 metros, cafeterias, restaurantes, comercios, bancos, correos, TRAM con dos paradas muy cerca y autobuses a 200 metros, pero en parcela privada de total tranquilidad. Playa de la Albufereta andando a 14 minutos, a 900 m de distancia. El club de Golf de Alicante andando a 950 metros. El club nautico a 800 metros, donde se puede practicar vela y otros deportes nauticos. El espectacular Gimnasio Arena a 800 metros. La Playa de San Juan a 1.900 metros, a 27 minutos caminando y a 7 minutos en coche. Los restos arqueologicos de Lucentum, antigua ciudad romana a 600 metros. El centro de la ciudad de Alicante a 6,7 kilometros, a 12 minutos, accesible en coche, tranvia o autobus, con las principales cadenas comerciales en la Avd. Maisonnave y sus animados restaurantes, pubs y discotecas. La divertida ciudad de Benidorm a 42 km y a 30 minutos en coche, con el parque de atracciones Terra Mitica, el parque de vida salvaje Terra Natura y el parque acuatico Aqualandia.', 'casa1.jpg', 'CASA', 6000.12, 500, 6, 5, false, true, true, true, 4, 'de4fab48-c431-54b6-ac87-3d5856774866');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (76, 'Piso en paseo heriz', 'Antiguo, Donostia-San Sebastian', 'En el barrio del Antiguo, en edificio de construccion reciente, alquilamos este caprichooso apartamento. Consta de salon comedor, cocina equipada y dormitorio con amplio armario y baño con ducha incorporado, tipo suite. Se accede a una amplia terraza tanto desde el salon como desde el dormitorio con vistas a la bahia, Monte Igeldo, Isla Santa Clara y Monte Urgul La carpinteria interior es de madera, ventanas climalit y los servicios individuales mediante caldera de gas natural. Dispone de un garaje cerrado motorizado en el mismo edificio de 28 m2. que esta comunicado con la vivienda mediante ascensor. Se solicitan nominas, 1 mes de fianza a depositar ante el gobierno vasco y 2 meses de deposito adicional. Los honorarios de la agencia inmobiliaria son por cuenta del inquilino. No se admiten mascotas.', 'piso.jpeg', 'PISO', 921.43, 43, 1, 1, true, false, true, false, 21, '2bd9e760-a11e-5d8f-9641-1c54e79c57a1');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (77, 'Casa adosada en Pau 2 - 600', 'Puertollano, Ciudad Real', 'Zona con preciosas vistas al parque de los patos. Unifamiliar con dos plantas, mas magnifica planta sotano con chimenea y muebles rusticos de diseño. Calefaccion individual y aire acondicionado en dormitorio principal. Cochera espaciosa.', 'casa2.jpeg', 'CASA', 525.7, 183, 3, 2, false, false, true, true, 18, '3e35d4f4-7716-54b2-9bdf-805ac4f5b6f0');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (78, 'Piso en calle Buen Suceso, 35', 'San Mames- La Palomera, Leon ', 'Piso precioso, amueblado, espacioso, y moderno. Muy luminoso, buena orientacion y con buenas vistas a zona despejada con areas verdes, deportivas y zonas infantiles. Salon-comedor muy amplio con orientacion sur-este. 3 dormitorios amplios con armarios empotrados, 2 baños grandes con bañera/ducha, uno de ellos en suite en el dormitorio principal. Cuarta habitacion pequeña con uso posible como despacho, de desahogo, etc. Despensa dentro del piso. Calefaccion y agua caliente individual, por gas natural. Trastero y comunidad incluidos en el precio. Suministros y agua a cargo del inquilino. Garaje optativo. 2 meses de fianza.', 'piso1.jpeg', 'PISO', 750.78, 132, 4, 2, true, false, true, true, 30, 'ce802e0d-45d6-55ca-90f2-5dc19d03f327');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (79, 'Chalet adosado en avenida de Don Pedro Hernando Sanz, 82', 'Los Robles, Seseña', 'AMPLIO Chalet pareado DE 242 M2 situado en Seseña VIEJO. Compuesto por 2 plantas: Primera Planta formada por salon independiente con acceso a PATIO, cocina office amueblado, baño completo, ademas de contar con un amplio patio trasero de 80 m y delantero. Segunda planta formada por dormitorio principal, con baño suite, 3 dormitorios dobles ademas de contar con un baño principal con bañera. La vivienda tiene muy buenas calidades, como armarios empotrados de gran capacidad en dormitorios. Es muy luminosa gracias a los grandes ventanales. El inmueble se encuentra en una zona de Seseña Viejo, Seseña, con servicios cercanos como supermercados de reciente apertura. La zona tiene facil acceso a la A-4 y esta comunicada por la red de transportes del municipio.', 'chalet2.jpeg', 'CHALET', 1000.54, 243, 4, 3, false, false, true, true, 48, '5bd0ab0d-7b12-5485-a1c2-83d3d463add8');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (80, 'Casa independiente en calle Hortensia, 46', 'San Gonzalo, Linares', 'El chalet esta muy bien situada frente a dos colegios primaria y secundaria. a 50 metros de centro de salud. 40 metros de polideportivo a 15 minutos de linea de autobuses. 10 minutos de estacion del tren. 50 metros parada autobus. doy a dos calles camelia y hortensia, . el precio del alquiler 999€ es para larga temporada obcion de compra entrada el 50% de momento este año solo alquiler de mayo a octubre para vacacional maximo de personas 6 o 7. El mes mayo desde semana 600€ 15 dias 1150€mes 2200€ mes de junio primera semana 650€ quincena 1200€ segunda quincena por semana 700€por quincena 1300€ mes 2400€ julio y agosto por semana 750€ 15dias 1,400€, por mes 2,600€ para el mes de septiembre 750€ la primera, quincena 1350€a partir del 15 de septiembre la semana 700€por15dias1300€por mes 2,400 y octubre 650€ primera semana por 15dias 1,250€ tercera semana 600€ quincena 1150€y por mes 2,300€ por fin de semana 400€. dejar limpio porfavor se desquitara 50€ para limpieza mas gastos. La fianza sera la misma que el alquiler, por semana, quincenas o mes que sera devuelta si no hay ningunos desperfectos, si no estan interesados en las condiciones no llamen para contactar mejor por wass y movil 647616423. Preguntar por Cati gracias.', 'casa.jpeg', 'CASA', 999.15, 320, 4, 4, false, true, true, true, 27, '3724f1a1-cfed-52ec-b1fa-9c41b6928648');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (81, 'Casa independiente en calle del Pare Lluis Navarro', 'El Cabanyal-El Canyamelar, València', 'Casa independiente en alquiler temporal en el barrio del Cabañal ALQUILER DE CORTA ESTANCIA  A PARTIR DE SEPTIEMBRE 2023. Alquiler de preciosa casita individual de dos plantas, a 5 minutos caminando a la playa. Esta bonita casa esta distribuida en dos plantas, en la parte de abajo se encuentra el salon comedor muy luminoso con sofa, 2 sillones, un Smart Tv de 50 pulgadas, con un baño completo y zona de trabajo adicional, con mesa extensible si lo necesitas. En la parte superior una habitacion con una amplia cama de matrimonio con otro Smart Tv, ventanas con aislamiento termico y acustico para una mayor tranquilidad, un segundo baño completo con ducha, una segunda zona de despacho y terraza privada con una pequeña fuente para disfrutar de agradables momentos de lectura o descanso. Se encuentra situado en el antiguo barrio del Cabañal, muy cerca de la playa, y muy bien comunicada con el centro de la ciudad, todos los servicios y transporte publico. Si le gustaria visitar esta vivienda, no dude en ponerse en contacto con nosotros, esteremos encantados de atenderle', 'casa1.jpg', 'CASA', 1450.02, 100, 1, 2, false, false, true, false, 49, '3e35d4f4-7716-54b2-9bdf-805ac4f5b6f0');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (82, 'Chalet pareado en Santa Marta de Tormes', 'area Metropolitana, Salamanca', 'Solucion inmobiliaria ofrece EN ALQUILER espectacular chalet pareado en la URB. ATIKA, una de las mejores Urbanizaciones de Salamanca, sin amueblar. El chalet consta de 74 m2 en la planta baja y en la 1º planta de 64 m2, distribuidos en 3 habitaciones, 3 baños, salon con salida a amplio balcon, cocina amueblada y equipada. Garaje de 63 m2 en planta baja con habitacion para almacenar y consta de jardin La Urbanizacion consta de zonas comunes como Piscina, Pista de Paddel, Tenis; jardines, etc. Este anuncio no es vinculante y puede contener errores; se muestra a titulo informativo y no contractual. Gracias por su tiempo.', 'chalet1.jpeg', 'CHALET', 900.76, 201, 3, 3, true, true, true, true, 41, 'ce802e0d-45d6-55ca-90f2-5dc19d03f327');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (83, 'Piso en Prat de la Riba', 'Princep de Viana-Clot, Lleida', 'REFORMA INTEGRAL EN PRAT DE LA RIBA Vivienda que disfruta de una magnifica ubicacion en la calle Prat de la Riba. Ha sido reformada integralmente, por lo que los inquilinos que la arrienden la estrenaran. Muy bien orientada al sur. Ventilacion cruzada. Edificio con ascensor y buen vecindario. Comunidad ordenada. Distribuida en tres habitaciones, dos de ellas dobles y una individual, un baño, cocina independiente, salon comedor y balcon. Pavimento de parquet, calefaccion individual de gas, cerramientos exteriores de aluminio, carpinteria interior lacada en blanco, bonito baño con plato de ducha. Perfecto para familias.', 'piso.jpeg', 'PISO', 749.61, 71, 3, 1, true, false, true, true, 32, 'f87239fd-e902-5cf7-8e9e-4b85bf5d323d');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (84, 'Piso en Olivar, 25', 'Lavapies-Embajadores, Madrid', 'Vivienda exterior con tres balcones en el salon a una calle muy tranquila. Recien reformada y perfecto estado. Muy luminosa. Calefaccion y aire acondicionado individuales. La cocina cuenta con lavadora/secadora y frigorifico. Se alquila sin muebles, aunque se da la opcion de dejar la cama y algun otro mueble si interesa al inquilino. Los gastos de comunidad estan incluidos en el precio. No incluidos los consumos (agua, electricidad, internet.. . ). Sin comision de agencia ni para el propietario ni para el inquilino. Requisitos: Contrato de trabajo indefinido y las 3 ultimas nominas. 1 mes de fianza y, si se quiere mobiliario, 1 mes de deposito.', 'piso1.jpeg', 'PISO', 875.59, 85, 6, 3, false, false, true, false, 33, '3e35d4f4-7716-54b2-9bdf-805ac4f5b6f0');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (85, 'Piso en calle San Millan', 'El Ejido, Malaga', '¡esta es tu oportunidad de conseguir un piso de calidad por un precio increible! Este fantastico piso de cuatro dormitorios se encuentra totalmente amueblado. Tiene una cocina equipada con todos los electrodomesticos necesarios. Ademas de ello, cuenta con dos grandes cuartos de baño. Esta a menos de 1 minutos de la Facultad del Ejido y tambien se encuentra muy bien comunicado con el centro, ya sea andando o via bus. Piso reformado, exterior muy soleado, aire acondicionado frio/calor en todas las estancias, baños y cocina de primera calidad. La zona le permite tambien disfrutar de todo tipo de servicios como restaurantes, bares, supermercados y centros de salud. ¡Venga a verlo! Se informa al cliente que los honorarios de agencia por los servicios prestados durante la operacion de arrendamiento son de 1 mensualidad. Asi tambien se pone en su conocimiento que es necesario acreditar SOLVENCIA mediante ingresos demostrables.', 'piso2.jpeg', 'PISO', 1600.38, 125, 4, 2, true, false, false, false, 28, '5bd0ab0d-7b12-5485-a1c2-83d3d463add8');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (86, 'Casa adosado en calle CASTILLO DE ALMORCHoN', 'Avda. Elvas, Badajoz', 'Se alquila vivienda en la urbanizacion Guadiana, zona tranquila rodeada de zonas verdes y de todas las necesidades del dia a dia. La vivienda se encuentra en perfecto estado (vivienda recien pintada al completo, cuartos de baños reformado (excepto uno) y cocina totalmente reformada con todos los electrodomesticos incluidos. La vivienda se divide de la siguiente manera: -En primera planta consta de salon, cocina con acceso a patio y un aseo -En segunda planta tendriamos cuatro dormitorios y dos cuartos de baños completos (uno en suite con el dormitorio principal) -En planta sotano tendriamos cochera privada con espacio para dos coches y moto e incluso zona de trastero. La vivienda se encuentra lista para poder entrar. Aprovecha la oportunidad y ven a verlo con nosotros.', 'casa2.jpeg', 'CASA', 900.96, 259, 4, 3, false, false, true, true, 8, '3724f1a1-cfed-52ec-b1fa-9c41b6928648');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (87, 'Piso en calle Colon, 7', 'Centro, Palencia', 'Apartamento centrico y exterior. Se exige solvencia economica para seguro de alquiler a cargo del arrendador. Disponible en marzo.', 'piso.jpeg', 'PISO', 390.94, 40, 1, 1, true, false, false, false, 39, '99ec6bb0-6c98-593c-812b-86ab4de48361');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (88, 'Chalet independiente en calle de la Muntanyeta de Sant Josep, 26', 'Zona Playa de la Concha, Oropesa del Mar', 'Villa luminosa familiar con jardin, a 100 metros de la playa de arena y a 50 de la zona de la Isleta y de las rocas. Espectaculares vistas sobre la playa de Morro de Gos, Alcocebre, Peñiscola. En la primera planta se encuentra el comedor con chimenea muy amplio, cocina con office donde puedes comer o desayunar, y un aseo. 4 dormitorios con armarios empotrados (2 de ellos con acceso a una terraza desde la que puedes ver un bonito amanecer) y 2 baños completos se encuentran en la planta superior. Garaje para 1 coche (con espacio ademas para moto, bicis o almacenaje) en el semisotano. Es posible aparcar otro vehiculo en el exterior de la vivienda. La casa esta rodeada por un jardin con barbacoa y otra amplia terraza para disfrutar junto a la brisa del mar. Solo alquiler de larga estancia, minimo 1 año.', 'chalet1.jpeg', 'CHALET', 900.13, 300, 4, 3, true, true, true, true, 16, 'f87239fd-e902-5cf7-8e9e-4b85bf5d323d');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (89, 'Casa independiente en Passatge Oriol', 'Valldoreix, Sant Cugat del Vallès', 'Casa practica con sus estancias principales en una sola planta, se compone de 3 habitaciones, 2 individuales y una de matrimonio. Las tres cuentan con armarios empotrados. Adicionalmente Un baño completo y un aseo de cortesia. Espacioso de salon comedor con cocina abierta con terraza a pie de salon. Parcela de 350 m2, que te ofrece zonas amplias para disfrutar de barbacoas con familia y amigos. Tiene accesos por dos calles. Por el lado de acceso de los coches tienes un espacio de almacen o trastero. Casa disponible para entrar cuando tu desees.', 'casa2.jpeg', 'CASA', 1529.37, 126, 3, 2, false, false, true, true, 10, '5bd0ab0d-7b12-5485-a1c2-83d3d463add8');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (90, 'Casa independiente en Iñas, cerca centro comercial', 'Nos, Oleiros', 'Planta alta de chalet con entrada y finca independientes. Amueblado. Cuenta con 4 habitaciones, 2 baños, salon y cocina. Todas las estancias son muy amplias. Buen estado. Cuenta con una bonita finca ajardinada e independiente de unos 1.000 m2. Dispone de dos plantas independientes que se alquilan por separado. Cada planta tiene su propia entrada y finca independiente. El entorno inmediato es muy tranquilo y a la vez bien comunicado, proximo al parque comercial de Oleiros. Condiciones de alquiler: -1 mes de fianza -1 mes garantia adicional -seguro de alquiler. -no se admiten mascotas.', 'casa.jpeg', 'CASA', 700.35, 120, 4, 2, false, false, true, true, 1, '2bd9e760-a11e-5d8f-9641-1c54e79c57a1');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (91, 'Piso en San Antonio Abad - Poligono San Anton', 'C/ Carmen Ibañez, Albacete', 'Oportunidad de piso totalmente reformado y amueblado, tanto las calidades de construccion como de mobiliario sonde gran calidad. Ventanas con: cristal climalit-rotura de puente termico, abatibles y oscilobatientes. Tarima sintetica ignifuga nivel 5, porcelanicos, puerta blindada etc. Consta de 96 m2 construidos distribuidos en 3 dormitorios, 2 cuartos de baño, 1 salon? comedor con salida a un balcon y 1 cocina independiente amueblada y equipada. la comunidad esta incluida, en la misma entran los suministros de calefaccion y agua. Incluye plaza de garaje en la misma finca. Disponible para marzo.', 'piso1.jpeg', 'PISO', 650.86, 96, 3, 2, true, false, true, false, 3, '5bd0ab0d-7b12-5485-a1c2-83d3d463add8');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (92, 'Chalet adosado en calle Gorbea, 1', 'Legutio, alava', 'ALQUILER CON OPCIoN A COMPRA Vivienda unifamiliar adosada de tres plantas en pleno centro de Legutiano. Posibilidad de intercambio por un piso o de alquiler con opcion a venta La casa se compone de la siguiente manera: Planta baja: Txoko, garaje y jardin exterior de 40m Planta primera, Entrada exterior de unos 20m2, recibidor, cocina, gran comedor, baño, y una pequeña habitacion que podria ser utilizada como desvan. Planta 2: Tres amplias habitaciones, todas exteriores con terraza y una de ellas con un bonito mirador al monte Gorbea. Planta 3: atico totalmente reformado en madera rustica con disponibilidad de agua. La distancia a Vitoria es de tan solo 12 km de autovia libre de peaje No dudes en preguntarnos por ella, somos flexibles con el precio indicado. Legutio es un precioso pueblo rodeado de hayedos, robledales y un embalse precioso unido al parque natural del Gorbea.', 'chalet.jpeg', 'CHALET', 1236.7, 210, 5, 4, false, false, true, true, 2, '3e35d4f4-7716-54b2-9bdf-805ac4f5b6f0');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (93, 'Piso en Centro', 'C/ Rua Mercado, Ourense', 'Apartamento con plaza de garaje en el centro, zona del parque Miño. Cuenta con 62m² distribuidos en recibidor, salon-comedor con cocina americana completamente amueblada y equipada, 2 habitaciones con armarios empotrados y 1 cuarto de baño con bañera. Dispone de plaza de garaje y trastero en el mismo edificio. Se encuentra amueblado. Para mas informacion contactanos al 988060259. SOMOS VIVIENDA.', 'piso.jpeg', 'PISO', 487.43, 62, 2, 1, true, false, false, true, 38, '5bd0ab0d-7b12-5485-a1c2-83d3d463add8');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (94, 'Piso en el Centro', 'C/ Feria, Sevilla', 'APARTAMENTO NUEVO DE 2 DORMITORIOS JUNTO A BASILICA Y RESOLANA. Apartamento amueblado de 2 dormitorios nuevo. Dispone de salon comedor, cocina amueblada y equipada independiente, baño y 2 dormitorios. Magnificas calidades y acabados. Exterior. Planta primera. Ascensor. Solo 3 vecinos. Zona muy tranquila. Junto a calle Resolana. Para mas informacion o visitas contacte con ALOJARIA GESTION INMOBILIARIA. 954218777-627569919.', 'piso1.jpeg', 'PISO', 746.91, 65, 2, 1, true, false, false, false, 43, '99ec6bb0-6c98-593c-812b-86ab4de48361');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (95, 'Piso en avenida de Juan XXIII', 'Nou Benicalap, València', '850 €/ mes, z/ nou benicalap, avda. Juan xxiii, vivienda vacia y con electrodomesticos, con plaza de garaje incluida, salon comedor amplio con balcon y aire acond. F/c, 3 habitaciones, cocina independiente, con galeria, 2 baños completos, uno en suite, arm. Empotrados, calef. Por radiadores, suelo de terrazo, buena ubicacion, para entrar. Ref. : 4321.', 'piso2.jpeg', 'PISO', 850.52, 86, 3, 2, true, false, true, false, 49, '5bd0ab0d-7b12-5485-a1c2-83d3d463add8');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (96, 'Piso en calle ALFONSO I', 'Alfonso, Zaragoza', 'Precioso y coqueto apartamento reformado en el centro de zaragoza. Nuevo a estrenar. Exterior a calle prudencio, con vistas a la basilica del pilar. Piso sin amueblar de un dormitorio con baño incorporado, salon-cocina completamente equipada. Tanto el salon como el dormitorio tienen balcones exteriores a calle alfonso. La calefaccion es electrica por radiadores y tiene ventiladores de techo, suelos de marmol y recien pintado. Grandes ventanales y balcones, muy luminoso. Comunidad incluida en la mensualidad. Sin comision de agencia. Es un sueño levantarte y ver las torres del pilar, situado en la calle alfonso.', 'piso.jpeg', 'PISO', 625.46, 45, 1, 1, true, false, true, false, 52, '3e35d4f4-7716-54b2-9bdf-805ac4f5b6f0');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (97, 'Piso en calle Argentina, 4', 'Los Bloques, Zamora', 'Piso pintado en su totalidad y con cocina y electrodomesticos a estrenar. Habitaciones con cerradura y mesas de escritorio. 2 camas de 105cm y 1 cama de 150cm. Totalmente exterior con terrazas. Se encuentra a 1 minuto del Campus Universitario. Comunidad incluida en el precio/mes.', 'piso2.jpeg', 'PISO', 476.72, 70, 3, 1, false, false, true, false, 51, '5bd0ab0d-7b12-5485-a1c2-83d3d463add8');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (98, 'Piso en VARSOVIA', 'El Guinardo, Barcelona', 'Apartamento en alquiler de 1 habitacion doble, balcon, salon y comedor independiente, muy soleado, baño reformado, cocina. Finca sin ascensor (4º). OBSERVACIONES: Alquiler de 4 a 11 meses. Precio mensual de alquiler 900€. Estan incluidos en el precio los gastos de la comunidad, el seguro y el IBI. No estan incluidos los honorarios de la agencia, ni los consumos de agua y luz.', 'piso.jpeg', 'PISO', 886.91, 40, 1, 1, false, false, true, false, 10, '99ec6bb0-6c98-593c-812b-86ab4de48361');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (99, 'Casa independiente en Bellas Artes', 'Montecanal-Valdespartera-Rosales del Canal, Zaragoza', 'Chalet independiente en Urbanizacion Montecanal, la mejor Zona Residencial de Zaragoza. Consta de 343 m2 construidos, 305 m2 utiles de vivienda en parcela de 324 m2, distribuidos en 4 PLANTAS, con 3 dormitorios dobles, ademas de JARDiN PRIVADO y GARAJE para 3 coches.', 'casa1.jpg', 'CASA', 1750.99, 343, 3, 3, false, false, true, true, 52, 'ce802e0d-45d6-55ca-90f2-5dc19d03f327');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (100, 'atico en San Vicente Ferrer, 74', 'Malasaña-Universidad, Madrid', 'Soñar Contigo presenta, en exclusiva, esta preciosa y especial estudio-buhardilla en la calle San Vicente Ferrer, en el barrio de Malasaña, una de las zonas mas cosmopolitas y modernas de la capital. La buhardilla ha sido saneada, reformada y modernizada por completo, manteniendo a la vista los elementos constructivos que le dan mas caracter, como el parche de ladrillo visto o las vigas de madera al aire pintadas en blanco. Nos encontramos ante una vivienda practica y con una gran personalidad, algo que se nota desde el momento en que entramos por la puerta. La buhardilla ha sido reamueblada por completo para su puesta a la venta, incluyendo electrodomesticos nuevos, y esta totalmente equipada para entrar a vivir, incluyendo textiles de cama y baño, vajilla, electrodomesticos, bateria de cocina, Smart TV, plancha, secador, exprimidor y cafetera Nespresso.', 'piso1.jpeg', 'PISO', 900.55, 30, 0, 1, false, false, false, false, 33, 'f87239fd-e902-5cf7-8e9e-4b85bf5d323d');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (101, 'Casa independiente en avenida Y Paseo Virgen de Consolacion, 7', 'C/ La Hiedra, Jaen', 'Este Adosado esta situado en el centro historico de Castellar. La entrada esta en una avenida peatonal con acceso al trafico rodeado por residentes. La actividad economica gira en torno a la agricultura y en especial a la olivicultura. Su extension superficial es de 159 km². Si te gusta el conectar con la naturaleza, vivir en un pueblo con una gente cercana y amigable. Podras disfrutar de su gran gastronomia y sus deliciosos aceites de oliva. Este adosado se compone de 4 plantas. Sin duda una de las joyas Inmobiliarias de Castellar. Pocas propiedades como esta podras encontrar en el pueblo. Destaca por sus materiales de construcciones y perfecta distribucion de sus estancias. En la planta principal podras encontrar 2 salones con chimenea donde poder encender una lumbre en las noches de frio donde reunirte con tu familia o amigos, 1 baño, cocina-comedor con chimenea y balcon con vistas infinitas de olivos y parte sierra morena. En la planta inferior podemos destacar el gran salon con minibar para reuniones y celebraciones. un despensero y salida a la zona de la piscina climatizada y vistas increibles que da a la parte de atras en una zona muy tranquila. En la primera planta se encuentran los dormitorios. 1 Dormitorio en Suite y 2 dormitorios mas 1 baño. El dormitorio en Suite destaca por su gran amplitud y vistas al interior y exterior de la casa. Tambien dispone de un balcon interior con vistas al salon principal de la planta principal. Los dormitorios sin suite tienen vistas a la piscina, a las montañas de olivos y sierra. En la ultima planta hay 2 dormitorios de invitados en suite muy amplios. En su arquitectura podemos destacar el diseño abierto y con gran luminosidad ya que el centro de la casa tiene un techo de cristal de gran resistencia que hace que siempre haya luz en toda la vivienda. La parte de la piscina con unas vista infinitas a un inmenso mar de olivos y sierra morena, es de las zonas que se pueden disfrutar tanto en invierno como en verano la tranquilidad de un pueblo muy hospitalario y buena gente, su gastronomia, fiestas y cultura. las ciudades de alrededor con patrimonio de la humanidad, sierra morena y sierra de Cazorla hace de jaen una ciudad con mucho encanto y una gran cultura. El clima mediterraneo hace que puedas tener una propiedad de lujo a un precio increible.', 'casa2.jpeg', 'CASA', 1486.43, 400, 6, 5, false, true, true, true, 27, 'ce802e0d-45d6-55ca-90f2-5dc19d03f327');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (102, 'Chalet pareado en Av de Europa s/n', 'Zona Avenida de Europa, Montequinto', 'Casa adosada de 2 habitaciones, 3 baños, cocina amueblada y dos patios ( uno de ellos con Cesped artificial). Totalmente reformada y en muy buen estado. Tiene La cocina totalmente amueblada con todos los electrodomesticos. El resto esta sin amueblar (Tal como las fotos) La casa se encuentra dentro de una urbanizacion, lo que hace que sea muy tranquila y con mucha privacidad. Piscina comunitaria, garaje individual para un vehiculo y un trastero en el jardin trasero. Se encuentra en una de las mejores zonas de Montequinto, junto al Parque de los Pinos, supermercados, colegios, farmacias, restaurantes, centros deportivos, etc. Tiene buena comunicacion con la parada de metro a unos 900 metros (10 min andando) y parada de autobus cerca La casa se alquila hasta Septiembre de 2024 aproximadamente. 1 mes de fianza, Contrato de trabajo/Renta año 2022, estabilidad financiera. Contactos por mensajes mediante wasap al telefono indicado (No llamadas).', 'chalet2.jpeg', 'CHALET', 976.19, 107, 2, 3, false, true, true, true, 43, '3e35d4f4-7716-54b2-9bdf-805ac4f5b6f0');
